import React from "react";

import SearchIcon from "@mui/icons-material/Search";
import OtherUsers from "./OtherUsers";

const Sidebar = () => {
  return (
    <div className="">
      <form action="">
        <div className="flex flex-row items-center bg-white rounded-lg">
          <input
            type="text"
            className="bg-transparent border-none outline-none p-1"
            placeholder="search..."
          />

          <button>
            {" "}
            <SearchIcon />{" "}
          </button>
        </div>
      </form>
      <div className="divider my-0 py-0 pt-4"></div>
      <OtherUsers />
      <div className="divider my-0 py-0"></div>
      <div>
        <button className="bg-white text-slate-800 w-full fond-bold tracking-wider rounded p-2" >LogOut</button>
      </div>
    </div>
  );
};

export default Sidebar;
